import React from "react";

const Button = (type, onClick, text) => {
    return (
        <button
            className="bg-[#5e913b] border-2 border-[#5e913b] px-[12px] py-[8px] rounded-lg text-white"
            onClick={onClick}
        >
            {text}
        </button>
    );
};

export default Button;
